subSubSection.paragraph:
In dorsal view mesonotum and mesoscutellum imbricate; in lateral view speculum with furrow, femoral depression smooth, posterior mesepimeral area delimited anteriorly by a mesepimeral sulcus with a crenulate furrow, dorsal and ventral metapleural area with crenulate depression with rugae (
Fig. 76
). Metapleural carina with two pointed projections, one adjacent to propodeal spiracle and second one at posterior margin (
Figs 75, 76
). Metascutellum visible in dorsal view, triangular, large metanotal spines slightly surpassing propodeum (
Figs 75, 76
).

Metasoma
. In dorsal view, tergites brown, in ventral view sternites brown, laterotergites yellowish. On T1 the pair of longitudinal submedial carinae are aligned with the metapleural carinae and separate lateral coriaceous microscupture from a microsculpure striate to coriaceous starting at basal grooves (
Fig. 11
). T2 with foveolate anterior margin; costulate to coriaceous, rounded specillum in the middle of T2, costae converging to posterior margin of specillum (
Fig. 11
).

